import logo from './logo.svg';
import './App.css';
import Login from './screens/login'
import React from 'react';


class App extends React.Component {
  state = {
    show_log_in: true
  }

  render() {
    if (this.state.show_log_in === false) {
      <Login></Login>
    }
  }
}

export default App;
